import { Link } from "react-router-dom";
import classes from "./Navbar.module.css";
import React from "react";

const NoFound = () => {
  return (
    <div>
      <h2>Sorry</h2>
      <p>Page Not Found</p>
      <Link to="/" className={classes.fancy_link}>Back to Home Page</Link>
    </div>
  );
};

export default NoFound;
